import React from "react";
import ReactDOM from "react-dom";


class GuestApp extends React.Component {
    constructor(props) {
        super(props);
        this.state = {role: "guest"}; 
        this.setState({
            fullName: 'Login',
        });
       // We will have "user" and "admin" roles too.
    }
    // Renders component based on current state and props
    render()
    {
        return (
                <div>
                <div id="navbar">
                <ul><nav>
                <li><a href="Coming Tours.html">Login</a></li>
                <li><a href="Login.html">New?Signup</a></li>
                <li><a href="Newsletter Signup.html">Current tours</a></li>
                <li><a href="About Us.html">About</a></li>
                <li><a href="Home.html">ContactUs</a></li>
                </nav>
                </ul> </div>


        </div>)

    }
}

export default GuestApp;
